import React, { useEffect, useRef } from "react";



const NaverMap = () => {
    // const mapElement = useRef(null);

    useEffect(() => {
        const {naver} = window;
        // if (!mapElement.current || !naver) return;

        const location = new naver.maps.LatLng(36.32787631122742, 127.42585033518178);

        const options = {
            center : location,
            zoom : 16,
            zoomControl : true,
            zommControlOptions: {position : naver.maps.Position.TOP_RIGHT}
        };
        const map = new naver.maps.Map('naverMap', options);

        new naver.maps.Marker({
            position: location,
            map: map
        });

    }, [])


    return (
        // <div ref={mapElement} style={{width:'100%', height:'100%', position:'relative', overflow:'hidden'}}></div>
        <div id="naverMap" style={{width:'1000px', height:'500px'}}></div>
    )
}

export default NaverMap;
